// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";

contract TokenLocker {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    struct LockedInfo {
        address tokenAddress;
        address withdrawalAddress;
        uint256 tokenAmount; // token amount initially locked
        uint256 unlockTime; // block.timestamp specified for the release time
        uint256 lastWithdrawTime;
        uint256 withdrawnAmount; // accumulative amount of token withdrawn
    }

    uint256 public depositId;
    mapping (address => uint256[]) public depositsByWithdrawalAddress;
    mapping (uint256 => LockedInfo) public lockedToken;
    mapping (address => mapping(address => uint256)) public walletTokenBalance; // token -> withdrawalAddress -> amount

    event LockInitiated(uint256 indexed id, address indexed tokenAddress, address indexed withdrawalAddress, uint256 amount);
    event Withdrawal(uint256 indexed id, address withdrawalAddress, uint256 amount);
    event LockExtended(uint256 indexed id, uint256 extendedDuration);

    /**
     * @dev lock tokens
    */
    function lockTokens(
        address _tokenAddress,
        address _withdrawalAddress,
        uint256 _amount,
        uint256 _unlockTime
    ) public returns (uint256 _id) {
        require(_amount > 0, "amount must be more than zero");
        require(_unlockTime > block.timestamp, "unlock time must be ahead in the future");

        uint256 preBalance = IERC20(_tokenAddress).balanceOf(address(this));

        _id = ++depositId;
        lockedToken[_id].tokenAddress = _tokenAddress;
        lockedToken[_id].withdrawalAddress = _withdrawalAddress;
        lockedToken[_id].unlockTime = _unlockTime;
        lockedToken[_id].lastWithdrawTime = 0;
        lockedToken[_id].withdrawnAmount = 0;

        depositsByWithdrawalAddress[_withdrawalAddress].push(_id);

        // transfer tokens into contract
        IERC20(_tokenAddress).transferFrom(msg.sender, address(this), _amount);
        uint256 postBalance = IERC20(_tokenAddress).balanceOf(address(this));

        // handling if the token has burn on transfer mechanism
        require(postBalance > preBalance, "transfer may have failed");
        uint256 addedAmount = postBalance.sub(preBalance);
        lockedToken[_id].tokenAmount = addedAmount;
        //update balance in address
        walletTokenBalance[_tokenAddress][_withdrawalAddress] = walletTokenBalance[_tokenAddress][_withdrawalAddress].add(addedAmount);
        emit LockInitiated(_id, _tokenAddress, _withdrawalAddress, addedAmount);
    }

    /**
     * @dev set the unlock time _additionalTime in the future relative to the stored unlockTime
     */
    function extendLockDuration(uint256 _id, uint256 _additionalTime) public {
        require(_additionalTime > 0, "addtionalTime must be more than zero");
        require(msg.sender == lockedToken[_id].withdrawalAddress, "only withdrawal address can extend");
        require(lockedToken[_id].unlockTime > block.timestamp, "must be extended only before release time");

        // set new unlock time
        lockedToken[_id].unlockTime = lockedToken[_id].unlockTime.add(_additionalTime);
    }

    /**
     * @dev view the amount of token can be withdrawn from the specified id
     * everyone can see and verify the amount
     */
    function tokenAvailableToWithdraw(uint256 _id) public view returns (uint256) {
        LockedInfo storage lockedInfo = lockedToken[_id];
        if (lockedInfo.unlockTime > block.timestamp) {
            return 0;
        }
        uint256 oneMonthSec = 30 * 24 * 60 * 60;

        // if never withdraw
        if (lockedInfo.lastWithdrawTime == 0) {
            uint256 timeDiff = uint256(block.timestamp).sub(uint256(lockedInfo.unlockTime));
            uint256 timeVar = timeDiff.div(oneMonthSec).add(1);
            if (timeVar <= 12) {
                // only allow monthly distribution after unlocked up until 12 months
                uint256 fractionAmount = timeVar.mul(lockedInfo.tokenAmount).div(12);
                return fractionAmount.sub(lockedInfo.withdrawnAmount);
            } else {
                return lockedInfo.tokenAmount.sub(lockedInfo.withdrawnAmount);
            }
        } else {
            uint256 timeDiff = uint256(block.timestamp).sub(uint256(lockedInfo.lastWithdrawTime));
            uint256 timeVar = timeDiff.div(oneMonthSec);
            if (timeVar <= 12) {
                uint256 fractionAmount = timeVar.mul(lockedInfo.tokenAmount).div(12);
                if (fractionAmount == 0) {
                    return 0;
                }
                return fractionAmount.sub(lockedInfo.withdrawnAmount);
            } else {
                return lockedInfo.tokenAmount.sub(lockedInfo.withdrawnAmount);
            }
        }
    }

    /**
     * @dev withdraw tokens
    */
    function withdrawTokens(uint256 _id) public {
        require(block.timestamp >= lockedToken[_id].unlockTime, "token still locked");
        require(msg.sender == lockedToken[_id].withdrawalAddress, "cannot withdraw others' token");

        address tokenAddress = lockedToken[_id].tokenAddress;
        uint256 withdrawAmount = tokenAvailableToWithdraw(_id);

        require(withdrawAmount > 0, "not allowed to withdraw");

        // update balance in address
        walletTokenBalance[tokenAddress][msg.sender] = walletTokenBalance[tokenAddress][msg.sender].sub(withdrawAmount);
        lockedToken[_id].withdrawnAmount = lockedToken[_id].withdrawnAmount.add(withdrawAmount);
        lockedToken[_id].lastWithdrawTime = block.timestamp;

        // remove this id from this address only when all have been withdrawn
        if (lockedToken[_id].tokenAmount.sub(lockedToken[_id].withdrawnAmount) == 0 ) {
            uint256 j;
            address withdrawalAddress = lockedToken[_id].withdrawalAddress;
            uint256 arrLength = depositsByWithdrawalAddress[withdrawalAddress].length;
            for (j = 0; j < arrLength; j++) {
                if (depositsByWithdrawalAddress[withdrawalAddress][j] == _id) {
                    uint256 nextId = depositsByWithdrawalAddress[lockedToken[_id].withdrawalAddress][arrLength - 1];
                    depositsByWithdrawalAddress[lockedToken[_id].withdrawalAddress][j] = nextId;
                    depositsByWithdrawalAddress[lockedToken[_id].withdrawalAddress].pop();
                    break;
                }
            }
        }

        // transfer tokens to wallet address
        IERC20(lockedToken[_id].tokenAddress).safeTransfer(msg.sender, withdrawAmount);
        emit Withdrawal(_id, msg.sender, withdrawAmount);
    }

    function totalTokenBalance(address _tokenAddress) public view returns (uint256) {
       return IERC20(_tokenAddress).balanceOf(address(this));
    }
}
